import React from 'react';
import Tilt from 'react-tilt'
import Brain from './brain.png'

const Logo = () => {
	return (
		<div>
			<Tilt className="Tilt pa3 ma3" options={{ max : 25 }} style={{ height: 150, width: 150 }} >
			 <div className="Tilt-inner br3 shadow-2"> <img src={{Brain}} /> </div>
			</Tilt>
		</div>
	);
}

export default Logo;
